import { useEffect, useState } from 'react';
export default function LeftMenu({onClick, selected}){
    const [exportButtonDisplay, setExportButtonDisplay] = useState(false);
    
return(
    <section className='menu-bar'>
        <h2 onClick={()=>onClick('legic')} className={`${selected === 'legic' && 'active'}`}>Legic</h2>
        <h2 className={`${selected === 'import' && 'active'}`}>Importar</h2>
        {exportButtonDisplay &&
            <>
                <h2 className={`${selected === 'export' && 'active'}`}>Exportar</h2>
                <h2 className={`${selected === 'status' && 'active'}`}>Status</h2>
            </>
        }
    </section>
)

}
